import React,{Component} from 'react';
import { Link } from 'react-router-dom';


class RequestList extends Component{
  constructor(props){
      super(props);
      this.state={
        resolution:[
          {
            "nid":"111",
            "creation_date":"05-11-2019",
            "asset":{
              "type":"Respirador",
              "model":"Drager",
              "mark":"X25",
              "name":"SN:21312/ID1:0977/ID2:1111/ID3:8756666"
            },
            "state":{
