            },
            "urgency":{
              "name":"Urgente"
            },
            "urgency_reason":"Se necesita para esta semana",
            "problem":"no enciende"
          },
          {
            "nid":"333",
            "creation_date":"05-11-2019",
            "asset":{
              "type":"Respirador",
              "model":"Drager",
              "mark":"X25",
              "name":"SN:21312/ID1:0977/ID2:1111/ID3:8756666"
            },
            "state":{
              "name":"Conformidad"
            },
            "urgency":{
              "name":"Urgente"
            },
            "urgency_reason":"Se necesita para esta semana",
            "problem":"no enciende"
          }
        ],

        conformity:[
          {
            "nid":"111",
            "creation_date":"05-11-2019",
            "asset":{
              "type":"Respirador",
              "model":"Drager",
              "mark":"X25",
              "name":"SN:21312/ID1:0977/ID2:1111/ID3:8756666"
            },
            "state":{
